exports=async function(a,b){const{parseInfo:c,strongAIntroPattern:d}=await require("transcode/parse_info");return c("\u4EBF\u7B14\u9601",`https://m.yibige.cc/${a}/`,[/<div class="info_t1">书名：(?<name>[^<]+)</,/<div class="info_t4">作者：<a [^>]+>(?<author>[^<]+)</,/<img (?:data-cf)?src="(?<cover>[^"]+)"/,/<div class="info_t3">状态：(?<serial>[^<]+)</,d],{clientOptions:{...(b&&b.clientOptions)}}).then(a=>(-1!==a.cover.indexOf("cdn-cgi")&&(a.cover="https"+a.cover.substring(a.cover.lastIndexOf("://"))),a))};